// src/pages/Vent/MyVents.jsx
import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Card, 
  CardContent, 
  Typography, 
  IconButton, 
  CircularProgress, 
  Grid, 
  Alert, 
  Button 
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import { useNavigate } from 'react-router-dom';
import { ventService } from '../../services/vent';
import { useAuth } from '../../contexts/AuthContext';

export default function MyVents() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [vents, setVents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (user && user._id) {
      fetchMyVents();
    }
  }, [user]);

  const fetchMyVents = async () => {
    setLoading(true);
    setError('');
    try {
      // Fetch all vents (or use a dedicated endpoint if available)
      const res = await ventService.getVents({ sort: 'recent', page: 1, limit: 50 });
      if (res.data && res.data.vents) {
        // Filter vents to only include those created by the current user.
        const myVents = res.data.vents.filter(vent => vent.userId === user._id);
        setVents(myVents);
      }
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to fetch your vents');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (ventId) => {
    if (window.confirm('Are you sure you want to delete this vent?')) {
      try {
        await ventService.deleteVent(ventId);
        // Refetch vents after deletion
        fetchMyVents();
      } catch (err) {
        alert(err.response?.data?.message || 'Failed to delete vent');
      }
    }
  };

  return (
    <Box 
      sx={{ 
        p: 3, 
        minHeight: '100vh', 
        background: 'linear-gradient(135deg, #80DEEA, #CE93D8)', 
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center'
      }}
    >
      <Typography variant="h4" sx={{ mb: 3, color: '#333', fontWeight: 700 }}>
        My Vents
      </Typography>

      {loading ? (
        <CircularProgress />
      ) : error ? (
        <Alert severity="error" sx={{ mb: 3 }}>{error}</Alert>
      ) : vents.length === 0 ? (
        <Typography variant="body1" sx={{ color: '#555', mb: 3 }}>
          You haven't created any vents yet.
        </Typography>
      ) : (
        <Grid container spacing={2} sx={{ maxWidth: 900 }}>
          {vents.map((vent) => (
            <Grid item xs={12} key={vent._id}>
              <Card 
                sx={{ 
                  borderRadius: '16px', 
                  p: 2, 
                  position: 'relative', 
                  cursor: 'pointer'
                }}
                onClick={() => navigate(`/vent/${vent._id}`)}
              >
                <CardContent>
                  <Typography variant="h5" sx={{ fontWeight: 600, mb: 1 }}>
                    {vent.title}
                  </Typography>
                  <Typography variant="body1" sx={{ mb: 1 }}>
                    {vent.text}
                  </Typography>
                  <Typography variant="caption" color="textSecondary" sx={{ display: 'block', mb: 1 }}>
                    {new Date(vent.createdAt).toLocaleString()}
                  </Typography>
                  <IconButton 
                    onClick={(e) => { e.stopPropagation(); handleDelete(vent._id); }} 
                    sx={{ position: 'absolute', top: 8, right: 8 }}
                    aria-label="delete"
                  >
                    <DeleteIcon color="error" />
                  </IconButton>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}

      <Button 
        variant="contained" 
        sx={{ mt: 3, backgroundColor: '#4a90e2' }} 
        onClick={() => navigate('/vent/create')}
      >
        Create New Vent
      </Button>
    </Box>
  );
}
